import React from "react";
import * as style from '../../styles/createStyle';
import { TreeSelect } from 'antd';

const treeData = [
  {
    title: '한식',
    value: '0-0',
    children: [
      {
        title: '밥',
        value: '0-0-1',
      },
      {
        title: '국',
        value: '0-0-2',
      },
      {
        title: '면',
        value: '0-0-3',
      },
    ],
  },
  {
    title: '중식',
    value: '0-1',
  },
  {
    title: '양식',
    value: '0-2',
  },
  {
    title: '디저트',
    value: '0-3',
    children: [
      {
        title: '구움과자',
        value: '0-3-1',
      },
      {
        title: '빵',
        value: '0-3-2',
      },
      {
        title: '케이크',
        value: '0-3-3',
      },
    ],
  },
  {
    title: '다이어트식',
    value: '0-4',
  },
];



export function Category({ register, name, category, onChange, ...rest }:any) {
  return (
    <TreeSelect
        {...register(name)} {...rest}
        style={{ width: '100%' }}
        value={category}
        dropdownStyle={{ maxHeight: 400, overflow: 'auto' }}
        treeData={treeData}
        placeholder="Please select"
        treeDefaultExpandAll
        onChange={onChange}
      />
  );
}
